import { HeaderContainer,HeaderSubContainer, PrimaryGlowingButton, SearchBar } from "./Utility";

function Header() {
    return (
    <div>
    <HeaderContainer>
        <HeaderSubContainer>PLAN R</HeaderSubContainer>
        <HeaderSubContainer>
            <SearchBar>Search</SearchBar>
        </HeaderSubContainer>
        <HeaderSubContainer>
            <PrimaryButton>Account</PrimaryButton>
            <PrimaryButton>Notify</PrimaryButton>
        </HeaderSubContainer>
    </HeaderContainer>
    </div>
  );
}

export default Header;
